import { Card } from "react-bootstrap";
import { WeightDifferenceTextProps } from "../Interfaces/Weight";

function WeightDifferenceText({data}: WeightDifferenceTextProps) {
  const latest = data!.at(-1)!; // Get the last element from the array
  const diff = (latest.currentWeight - latest.goalWeight).toFixed(2);

  return (
    <Card.Body>
      <Card.Title>Weight Difference</Card.Title>

      <span className="weight-difference">{diff} kg</span>
    </Card.Body>
  );
}

export default WeightDifferenceText;
